import React from 'react';

export const PlusIcon = () => <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor" strokeWidth={2}><path strokeLinecap="round" strokeLinejoin="round" d="M12 6v6m0 0v6m0-6h6m-6 0H6" /></svg>;
export const FlaskIcon = () => <svg xmlns="http://www.w3.org/2000/svg" className="h-12 w-12 mx-auto text-orange-200" fill="none" viewBox="0 0 24 24" stroke="currentColor" strokeWidth={1.5}><path strokeLinecap="round" strokeLinejoin="round" d="M14.25 5.25a3 3 0 01-3 3M11.25 5.25a3 3 0 00-3 3m-3.75 6.75a3 3 0 11-6 0 3 3 0 016 0zM21 15.75a3 3 0 11-6 0 3 3 0 016 0z" /><path strokeLinecap="round" strokeLinejoin="round" d="M4.125 6.375c.625-1.125 1.5-2.062 2.5-2.625m10.75 13.5c.625 1.125 1.5 2.062 2.5 2.625m-10.75-13.5c-1.125.625-2.062 1.5-2.625 2.5m10.75 13.5c-1.125-.625-2.062-1.5-2.625-2.5m-7.5-3.375a3 3 0 013-3h1.5a3 3 0 013 3v.75m-7.5 3.75a3 3 0 003 3h1.5a3 3 0 003-3v-.75" /></svg>;
export const TrashIcon = () => <svg xmlns="http://www.w3.org/2000/svg" className="h-4 w-4" fill="none" viewBox="0 0 24 24" stroke="currentColor" strokeWidth={2}><path strokeLinecap="round" strokeLinejoin="round" d="M19 7l-.867 12.142A2 2 0 0116.138 21H7.862a2 2 0 01-1.995-1.858L5 7m5 4v6m4-6v6m1-10V4a1 1 0 00-1-1h-4a1 1 0 00-1 1v3M4 7h16" /></svg>;
export const SparklesIcon = ({className}) => <svg xmlns="http://www.w3.org/2000/svg" className={className || "h-5 w-5"} viewBox="0 0 20 20" fill="currentColor"><path fillRule="evenodd" d="M5 2a1 1 0 011 1v1h1a1 1 0 010 2H6v1a1 1 0 01-2 0V6H3a1 1 0 010-2h1V3a1 1 0 011-1zm6 5a1 1 0 011 1v1h1a1 1 0 110 2h-1v1a1 1 0 11-2 0v-1H9a1 1 0 110-2h1V8a1 1 0 011-1zM9 15a1 1 0 011-1h.01a1 1 0 110 2H10a1 1 0 01-1-1zM3 8a1 1 0 011-1h.01a1 1 0 110 2H4a1 1 0 01-1-1zM16 3a1 1 0 01-1 1h-.01a1 1 0 110-2H15a1 1 0 011 1zM11 3a1 1 0 01-1 1h-.01a1 1 0 110-2H10a1 1 0 011 1zM16 8a1 1 0 01-1 1h-.01a1 1 0 110-2H15a1 1 0 011 1z" clipRule="evenodd" /></svg>;
export const BeakerIcon = () => <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5" viewBox="0 0 20 20" fill="currentColor"><path fillRule="evenodd" d="M7 2a1 1 0 00-1 1v1.132a7.002 7.002 0 00-2.222 2.223A.999.999 0 003.5 7.5v6.242a3.5 3.5 0 005.105 3.193l.395-.198a3.502 3.502 0 00-2.23-6.393V7.5a.5.5 0 01.5-.5h4a.5.5 0 01.5.5v2.344a3.502 3.502 0 00-2.23 6.393l.395.198A3.5 3.5 0 0016.5 13.742V7.5a.999.999 0 00-.278-1.145A7.002 7.002 0 0014 4.132V3a1 1 0 10-2 0v1h-2V3a1 1 0 00-1-1H7zm2 11a1.5 1.5 0 100-3 1.5 1.5 0 000 3z" clipRule="evenodd" /></svg>;
